SELECT sp.identificacion, sp.numero_solicitud, sl.numero_solicitud,  sa.numero_solicitud, sa.cod_neg, n.cod_neg,  
	   sp.numero_solicitud,
	   sp.tipo, 
	   sp.identificacion, 
	   sp.nombre , 
	   sl.direccion AS dir_trabajo, 
	   sl.ciudad AS ciu_trabajo, 
	   c.nomciu as nombre_ciudad_trabajo,  
	   sl.departamento as dpto_trabajo, 
	   e.department_name AS nombre_dpto_trabajo
FROM solicitud_persona sp
INNER JOIN solicitud_laboral sl ON (sl.numero_solicitud = sp.numero_solicitud )
INNER JOIN solicitud_aval sa ON (sa.numero_solicitud = sp.numero_solicitud)
INNER JOIN negocios n ON (n.cod_neg = sa.cod_neg AND n.estado_neg = 'T')
INNER JOIN ciudad c ON (c.codciu = sl.ciudad)
INNER JOIN estado e ON (e.department_code = sl.departamento)
WHERE sp.tipo = 'C' and
(SELECT sum(valor_saldo) FROM con.factura fac WHERE fac.negasoc = sa.cod_neg) > 0 AND 
